CKEDITOR.plugins.setLang("a11yhelp","fi",{title:"Saavutettavuus ohjeet",contents:"Ohjeen sis\xe4ll\xf6t. Sulkeaksesi t\xe4m\xe4n dialogin paina ESC.",legend:[{name:"Yleinen",items:[{name:"Editorin ty\xf6kalupalkki",legend:"Paina ${toolbarFocus} siirty\xe4ksesi ty\xf6kalupalkkiin. Siirry seuraavaan ja edelliseen ty\xf6kalupalkin ryhm\xe4\xe4n TAB ja SHIFT-TAB n\xe4pp\xe4imill\xe4. Siirry seuraavaan ja edelliseen ty\xf6kalupainikkeeseen k\xe4ytt\xe4m\xe4ll\xe4 NUOLI OIKEALLE tai NUOLI VASEMMALLE n\xe4pp\xe4imill\xe4. Paina V\xc4LILY\xd6NTI tai ENTER n\xe4pp\xe4int\xe4 aktivoidaksesi ty\xf6kalupainikkeen."},{name:"Editorin dialogi",legend:"Dialogin sis\xe4ll\xe4, painamalla TAB siirryt seuraavaan dialogin kentt\xe4\xe4n, painamalla SHIFT+TAB siirryt aiempaan kentt\xe4\xe4n, painamalla ENTER l\xe4het\xe4t dialogin, painamalla ESC peruutat dialogin. Dialogeille joissa on useita v\xe4lilehti\xe4, paina ALT+F10 siirty\xe4ksesi v\xe4lillehtilistaan. Siirty\xe4ksesi seuraavaan v\xe4lilehteen paina TAB tai NUOLI OIKEALLE. Siirry edelliseen v\xe4lilehteen painamalla SHIFT+TAB tai nuoli vasemmalle. Paina V\xc4LILY\xd6NTI tai ENTER valitaksesi v\xe4lilehden."},{name:"Editorin oheisvalikko",legend:"Paina ${contextMenu} tai SOVELLUSPAINIKETTA avataksesi oheisvalikon. Liiku seuraavaan valikon vaihtoehtoon TAB tai NUOLI ALAS n\xe4pp\xe4imill\xe4. Siirry edelliseen vaihtoehtoon SHIFT+TAB tai NUOLI YL\xd6S n\xe4pp\xe4imill\xe4. Paina V\xc4LILY\xd6NTI tai ENTER valitaksesi valikon kohdan. Avataksesi nykyisen kohdan alivalikon paina V\xc4LILY\xd6NTI tai ENTER tai NUOLI OIKEALLE painiketta. Siirty\xe4ksesi takaisin valikon ylemm\xe4lle tasolle paina ESC tai NUOLI vasemmalle. Oheisvalikko suljetaan ESC painikkeella."},{name:"Editorin listalaatikko",legend:"Listalaatikon sis\xe4ll\xe4 siirry seuraavaan listan kohtaan TAB tai NUOLI ALAS painikkeilla. Siirry edelliseen listan kohtaan SHIFT+TAB tai NUOLI YL\xd6S painikkeilla. Paina V\xc4LILY\xd6NTI tai ENTER valitaksesi listan vaihtoehdon. Paina ESC sulkeaksesi listalaatikon."},{name:"Editorin elementtipolun palkki",legend:"Paina ${elementsPathFocus} siirty\xe4ksesi elementtipolun palkkiin. Siirry seuraavaan elementtipainikkeeseen TAB tai NUOLI OIKEALLE painikkeilla. Siirry aiempaan painikkeeseen SHIFT+TAB tai NUOLI VASEMMALLE painikkeilla. Paina V\xc4LILY\xd6NTI tai ENTER valitaksesi elementin editorissa."}]},{name:"Komennot",items:[{name:"Peruuta komento",legend:"Paina ${undo}"},{name:"Tee uudelleen komento",legend:"Paina ${redo}"},{name:"Lihavoi komento",legend:"Paina ${bold}"},{name:"Kursivoi komento",legend:"Paina ${italic}"},{name:"Alleviivaa komento",legend:"Paina ${underline}"},{name:"Linkki komento",legend:"Paina ${link}"},{name:"Pienenn\xe4 ty\xf6kalupalkki komento",legend:"Paina ${toolbarCollapse}"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:"Saavutettavuus ohjeet",legend:"Paina ${a11yHelp}"}]}]});